import React from 'react';
import '../requists/requist.scss';

export default function Requist () {
    return (
        <div className='requist__container'>
            <tr className='table__row__container'>
                <td className='ptw__data'>ptw-547</td>
                <td className='ptw__data'>operation</td>
                <td className='ptw__data'>ahmed eldessouki</td>
                <td className='ptw__kks'>61uba01</td>
                <td className='ptw__data'>civil</td>
                <td className='ptw__accept'><button>Accept</button></td>
                <td className='ptw__reject'><button>Reject</button></td>
            </tr>
        </div>
    )
}
